Last Day of the Dinosaur (DC)

History Documentary hosted by Bill Mondy, published by Discovery Channel in 2010 - English narration


Information
------------------------------

Last Day of the Dinosaur
Take a seat at the heart of the most dramatic event in Earths history: a fully immersive thrill ride of mega tsunamis, terrifying meteor showers, off the scale earthquakes, volcanic eruptions, fire storms bitter acid rain and a chilling nuclear winter. We go from the impact of the great meteor, through its terrible after effects to the eventual emergence of a new mammalian dominance from the ashes of a dead world.

